import './App.css';
import {BrowserRouter, Routes, Route, Router} from "react-router-dom";
import MainPage from './screens/MainPage';

function App() {
  return (
    <div className="App">
        <Router>
            <div className="container">
                <Routes>
                    <Route path={'/'} element={<MainPage />} />
                </Routes>
            </div>
        </Router>
    </div>
  );
}

export default App;
